{&quot;name&quot;:&quot;unicorn_cleaner&quot;,&quot;type&quot;:&quot;code/bash&quot;,&quot;content&quot;:&quot;#!/bin/bash

# Update and upgrade Termux packages
pkg update -y &amp;&amp; pkg upgrade -y

# Install useful tools
pkg install -y busybox net-tools psmisc

# Check for suspicious running processes
echo \&quot;Checking for suspicious running processes...\&quot;
ps aux | grep -E &#x27;unicorn|spy|keylog|tracker|stealth|hidden&#x27; | grep -v grep

# Identify suspicious installed packages
echo \&quot;Identifying suspicious installed packages...\&quot;
pm list packages | grep -E &#x27;unicorn|spy|track|hidden|monitor&#x27;

# Find suspicious files and folders in accessible directories
echo \&quot;Scanning files for suspicious names...\&quot;
find /sdcard /storage -type f -iname \&quot;*unicorn*\&quot; -o -iname \&quot;*spy*\&quot; -o -iname \&quot;*keylog*\&quot; -o -iname \&quot;*tracker*\&quot; -o -iname \&quot;*stealth*\&quot; -o -iname \&quot;*hidden*\&quot;

# Optional: Remove suspicious apps (uncomment carefully)
# echo \&quot;Removing suspicious apps...\&quot;
# pm list packages | grep -E &#x27;unicorn|spy|track|hidden|monitor&#x27; | sed &#x27;s/package://&#x27; | xargs -n1 pm uninstall -k --user 0

echo \&quot;Scan completed. Review the output carefully before proceeding to deletion.\&quot;&quot;}
